const axios = require('axios');

export const authorizeInstagram = () => {
  return axios.post(`/authorize`, { username: process.env.REACT_APP_INSTAGRAM_USERNAME, password: process.env.REACT_APP_INSTAGRAM_PASSWORD } )
  .then((response) => {
    console.log(response)
    return response.data;
  })
}

export const searchInstagram = (query) => {
  return axios.get(`/search/${query}`)
  .then((response) => {
    console.log(response);
    return response.data;
  })
}
